Overview

Dell inspiron 16 touchscreen laptop for college students powered by the new Intel Core 7 150U (10-Core) processor and fast wireless Wi-Fi 6E for high performance, instant responsiveness to get things done fast; Perfect for learning or working anywhere;

Dell laptop touchscreen windows 11 features 16inch FHD+ touch display shows come to life in true-to-life color and crisp, clear details;

Dell business laptop Windows 11 laptop with Microsoft 365: Bring your ideas to life. Your creativity now gets a boost with Microsoft 365. Office - Word, Excel, and PowerPoint. One year subscription included;

Dell laptop computer with Backlit Keyboard allows you to enjoy comfortable and accurate typing, even in dim lighting;

Dell inspiron 16 plus with Fingerprint reader for quick secure sign-in;

Dell 16 plus laptop i7 with HDMI, USB Type-C port, making connection easier and faster;

Work laptop office pc portatil features 10.5hours long battery life and fast charge design let you get work done without worrying about recharging.

Specification

Operating System: Windows 11

Display: 16" FHD+ (1920 x 1200) 300-Nits Touchscreen with ComfortView Plus Support

Processor: Intel Core 7 150U (10-Core)

Graphics: Integrated Intel Graphics

Network & Communication: Wireless Wi-Fi 6E + Bluetooth

Keyboard: Ice Blue Backlit Keyboard; Fingerprint Reader

Audio: Waves MaxxAudio Pro, Supports Atmos Core

Webcam: 1080p FHD Webcam with Built-in Privacy Shutter and Dual Array Microphones

Battery: 4-cell Li-ion Polymer, 10.5 hours maximum battery run time

Ports:
1x USB 3.2 Gen 2 Type-C (DisplayPort and Power Delivery);
2x USB 3.2 Gen 1 Type-A;
1x HDMI 1.4;
1x Universal Audio Jack;
1x SD Card Reader

Additional Information:
Dimension: 14.05"W x 9.82"D x 0.64"H;
Weight: 4.12 lbs
